q = group q by 'NAME';
c = group c by 'Name';
r = cogroup q by 'NAME' left, c by 'Name';
r = foreach r generate q.'NAME' as 'NAME', ((max(q.'AUM') - max(c.'AUM'))/max(q.'AUM'))*100 as 'AUM Change',max(q.'DAYSSINCELASTINTERACTION') as 'Days Since Last Contact';
