Activity_metric_bar.query:
q = load "${App.Datasets.FscDemoActivity.FullyQualifiedName}";
q= filter q by 'ACCOUNTRECORDTYPENAME' !="Household";
q_B = filter q by 'TYPE' == "Call";
q_C = filter q by 'RECORDTYPENAME' matches "Task";
q_D = filter q by 'TYPE' == "Email";
q_E = filter q by 'RECORDTYPENAME' matches "Task" ;
q_E =  foreach q_E generate ID as 'ID', 'ACTIVITYDATE' as 'ACTIVITYDATE', date_diff("day",toDate(ACTIVITYDATE,"yyyy-MM-dd"),now()) as 'overdue_date', 'STATUS' as 'STATUS';
q_E = filter q_E by 'overdue_date'>0;
q_E = filter q_E by 'STATUS' != "Completed";
result = group q by all full, q_B by all full, q_C by all full, q_D by all full, q_E by all;
result = foreach result generate count(q) as 'Total', count(q_B) as 'Call', count(q_C) as 'Task', count(q_D) as 'Email', count(q_E) as 'Other_Tasks';
result = order result by ('Total' desc);
result = limit result 2000;

